import React from 'react'
import { Image, Card } from 'semantic-ui-react';

const Audiocard = ({audiocard}) => {

    if (audiocard.created_at){
        const convertDate = audiocard.created_at.split('T')[0].split('-')
        const newDate = new Date(convertDate).toDateString()
    }

    return (
            <Card>
                <Image src={audiocard.image} /> 
                <Card.Content>
                    <Card.Header>{audiocard.soundster}</Card.Header>
                    <Card.Meta>
                        <span className='date'></span>
                    </Card.Meta>
                </Card.Content>
            </Card>

    )
}

export default Audiocard;
